import React, { Component }  from 'react';

const GioiThieu = () => {
    return (
        <div className='gioi-thieu'>
            <h1>GIỚI THIỆU VỀ DOANH NGHIỆP TƯ NHÂN CƠ KHÍ CƯỜNG THỊNH</h1>
            <h1 style={{color : "red", marginTop : "0px"}}>Gioi thieu</h1>
        </div>
        
    );
    
  };
  
  export default GioiThieu;
